import React from 'react';
import "./App.css";


function Phoneme({symbol, easyType, type, notes}){
    return(
        <div className="phoneme">
            <h3>{symbol}</h3>
            <h3>{easyType}</h3>
            <h3>{type}</h3>
            <p>{notes}</p>
        </div>
    );
}

